import React from 'react';
import { Modal, Button } from 'react-bootstrap';


type FileListDialogProps = {
    show: boolean;
    playGameVsAgent: boolean;
    handleClose: () => void;
    filesList: string[];
}

const FileListDialog: React.FC<FileListDialogProps> = ({ show, playGameVsAgent, handleClose, filesList }) => {
    return (
        <Modal show={show} onHide={handleClose}   style={{ position: "absolute", left: "10%", top: "10%" }}>
            <Modal.Header>
                <Modal.Title>
                    {playGameVsAgent ? "Choose the agent" : "Choose the agent's game"}
                </Modal.Title>
            </Modal.Header>
            <Modal.Body>
                {filesList.length === 0 ? (
                    <p>No files available!</p>
                ) : (
                    <ul>
                        {filesList.map((file_name, idx) => (
                            <li key={idx}>{file_name}</li>
                        ))}
                    </ul>
                )}
            </Modal.Body>
        </Modal>
    );
};

export default FileListDialog;
